import Link from "next/link";
import axios from "axios";

export default function Index() {
  return (
    <>
      <p>Hello I am home page</p>
      <Link href="/about">
        <a>About</a>
      </Link>
    </>
  );
}

Index.getInitialProps = function () {
  var data = {};
  axios.get("https://api.tvmaze.com/search/shows?q=sherlock").then((res) => {
    data = res.data;
  });

  return {
    data,
  };
};
